using RceSharpLib;
using RpzwRelay.Handlers;
using System;
using System.Collections.Generic;
using System.Threading.Tasks;

namespace RpzwRelay
{
	class Program
	{
		static async Task Main(string[] args)
		{
			var rceJobRunner = new RceJobRunnerBuilder()
				.SetBaseUrl("https://rceserver.azurewebsites.net")
				.SetWorkerName("Power Relay Controller")
				.SetWorkerDescription("Remote controller for a relay")
				.SetWorkerBase64Logo("data:image/png;base64,")
				.SetOwners(new List<string> { "demo@example.com" })
				.SetRunInParallel(false)
				.AddJobHandlerType(typeof(TurnOnHandler))
				.AddJobHandlerType(typeof(TurnOffHandler))
				.AddJobHandlerType(typeof(TimerHandler))
				.Build();
			_ = Task.Run(rceJobRunner.Start);

			Console.WriteLine("Press any key to exit");
			Console.WriteLine();
			Console.ReadKey();
			Console.WriteLine();
			Console.WriteLine("Exiting...");
			await rceJobRunner.Stop();
		}

	}
}
